u0433\u043e \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0438\u044f \u0436\u0430\u043b\u043e\u0432\u0430\u043d\u0438\u044f, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D0%B7%D0%B3%D1%80%D0%B0%D0%B1%D0%BB%D0%B5%D0%BD%D0%B8%D0%B5_%D0%A0%D0%B8%D0%BC%D0%B0_(1527_%D0%B3%D0%BE%D0%B4)\" class=\"mw-redirect\" title=\"\u0420\u0430\u0437\u0433\u0440\u0430\u0431\u043b\u0435\u043d\u0438\u0435 \u0420\u0438\u043c\u0430 (1527 \u0433\u043e\u0434)\">\u0432\u0437\u044f\u043b\u0438 \u0448\u0442\u0443\u0440\u043c\u043e\u043c \u0438 \u0440\u0430\u0437\u0433\u0440\u0430\u0431\u0438\u043b\u0438 \u0420\u0438\u043c<\/a>. \u041f\u0430\u043f\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BB%D0%B8%D0%BC%D0%B5%D0%BD%D1%82_VII\" title=\"\u041a\u043b\u0438\u043c\u0435\u043d\u0442 VII\">\u041a\u043b\u0438\u043c\u0435\u043d\u0442\u0443 VII<\/a> \u0443\u0434\u0430\u043b\u043e\u0441\u044c \u0441\u043f\u0430\u0441\u0442\u0438\u0441\u044c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1626\" class=\"mw-redirect\" title=\"1626\">1626<\/a>&#160;\u2014 \u0413\u043e\u043b\u043b\u0430\u043d\u0434\u0441\u043a\u0438\u0439 \u043a\u043e\u043b\u043e\u043d\u0438\u0441\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D0%BD%D1%91%D0%B9%D1%82,_%D0%9F%D0%B5%D1%82%D0%B5%D1%80\" title=\"\u041c\u0438\u043d\u0451\u0439\u0442, \u041f\u0435\u0442\u0435\u0440\">\u041f\u0435\u0442\u0435\u0440 \u041c\u0438\u043d\u0451\u0439\u0442<\/a> (Peter Minuit) \u043f\u0440\u0438\u043e\u0431\u0440\u0451\u043b \u0443 \u0438\u043d\u0434\u0435\u0439\u0446\u0435\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BD%D1%85%D1%8D%D1%82%D1%82%D0%B5%D0%BD\" title=\"\u041c\u0430\u043d\u0445\u044d\u0442\u0442\u0435\u043d\">\u041c\u0430\u043d\u0445\u044d\u0442\u0442\u0435\u043d<\/a> \u0437\u0430 \u0433\u043e\u0440\u0441\u0442\u044c \u0431\u0438\u0436\u0443\u0442\u0435\u0440\u0438\u0438 \u0441\u0442\u043e\u0438\u043c\u043e\u0441\u0442\u044c\u044e 25 \u0434\u043e\u043b\u043b\u0430\u044