9 \u0437\u0430\u043b\u0438\u0432\">\u0411\u0435\u043d\u0433\u0430\u043b\u044c\u0441\u043a\u043e\u043c \u0437\u0430\u043b\u0438\u0432\u0435<\/a> \u0431\u044b\u043b\u043e \u0437\u0430\u0441\u0442\u0438\u0433\u043d\u0443\u0442\u043e \u0446\u0438\u043a\u043b\u043e\u043d\u043e\u043c \u0431\u043b\u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D0%BD%D0%B3%D1%83%D0%BD\" class=\"mw-redirect\" title=\"\u0420\u0430\u043d\u0433\u0443\u043d\">\u0420\u0430\u043d\u0433\u0443\u043d\u0430<\/a> \u0438 \u043f\u043e\u0442\u0435\u0440\u043f\u0435\u043b\u043e \u043a\u0440\u0443\u0448\u0435\u043d\u0438\u0435 \u0441\u0443\u0434\u043d\u043e \u00ab<a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%9A%D0%B0%D0%BC%D0%BE%D1%80%D1%82%D0%B0&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u041a\u0430\u043c\u043e\u0440\u0442\u0430 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u041a\u0430\u043c\u043e\u0440\u0442\u0430<\/a>\u00bb (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D1%8F%D0%B7%D1%8B%D0%BA\" title=\"\u0410\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0439 \u044f\u0437\u044b\u043a\">\u0430\u043d\u0433\u043b.<\/a>&#160;<a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%C2%ABCamorta%C2%BB&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u00abCamorta\u00bb (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u00abCamorta\u00bb<\/a> ) \u043f\u043e\u0434 \u0444\u043b\u0430\u0433\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a>; \u0447\u0438\u0441\u043b\u043e \u043f\u043e\u0433\u0438\u0431\u0448\u0438\u0445 \u0441\u043e\u0441\u0442\u0430\u0432\u0438\u043b\u043e 655 \u0447\u0435\u043b\u043e\u0432\u0435\u043a .<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1904\" class=\"mw-redirect\" title=\"1904\">1904<\/a>&#160;\u2014 \u041d\u0430 \u0441\u0442\u0430\u043d\u0446\u0438\u0438 \u041a\u0443\u0447\u0438\u043d\u043e, \u043f\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u043e\u0439<\/a>, \u043e\u0442\u043a\u0440\u044b\u0442 \u0410\u044d\u0440\u043e\u0434\u0438\u043d\u0430\u043c\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0438\u043d\u0441\u0442\u0438\u0442\u0443\u0442 (\u0431\u0443\u0434\u0443\u0449\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D0%90%D0%93%D0%98\" title=\"\u0426\u0410\u0413\u0418\">\u0426\u0410\u0413\u0418<\/a>), \u043e\u0441\u043d\u043e\u0432\u0430\u0442\u0435\u043b\u0435\u043c \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043f\u0440\u043e\u0444\u0435\u0441\u0441\u043e\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%96%D1%83%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9,_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_%D0%95%D0%B3%D0%BE%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0416\u0443\u043a\u043e\u0432\u0441\u043a\u0438\u0439, \u041d\u0438\u043a\u043e\u043b\u0430\u0439 \u0415\u0433\u043e\u0440\u043e\u0432\u0438\u0447\">\u041d.&#160;\u0415.&#160;\u0416\u0443\u043a\u043e\u0432\u0441\u043a\u0438\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1906\" class=\"mw-redirect\" title=\"1906\">1906<\/a>&#160;\u2014 \u041e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043d\u044b \u00ab\u041e\u0441\u043d\u043e\u0432\u043d\u044b\u0435 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0435 \u0437\u0430\u043a\u043e\u043d\u044b \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043